import React from "react";
import { useFormik } from 'formik';
import { FormControl, FormLabel, TextField } from "@mui/material";



const NewCustomerForm = () => {



    return(
        <form>
            <FormControl>
                <FormLabel>Nombre</FormLabel>
                <TextField 
                value={name}
                label='Nombre'
                variant="outlined"
                />
            </FormControl>
        </form>
    ) 

};

export default NewCustomerForm;
